import React, { Component } from 'react';
import SmallTable from './SmallTable';
import AccessButtons from './AccessButtons';
import SelectFilter from './SelectFilter';

export default class Sidebar extends Component {
    render() {
        return (
            <div align='center' style={{ marginBottom: '150px' }}>
                <h1 style={{ color: 'white', fontSize: '3vw' }}>ACCESS CONTROL</h1>
                <SelectFilter></SelectFilter>
                <SmallTable info={this.props.info}></SmallTable>
                <AccessButtons info={this.props.info} ></AccessButtons>
            </div>
        )
    }
}
